304:\"This is a massive update that is intended to maximize compatibility with the latest version of WordPress and other popular plugins. It also includes important security patches, new features, bug fixes, and a whole lot of important changes under the hood. Updating to this version is a MUST for everybody.\";s:4:\"beta\";s:304:\"This is a massive update that is intended to maximize compatibility with the latest version of WordPress and other popular plugins. It also includes important security patches, new features, bug fixes, and a whole lot of important changes under the hood. Updating to this version is a MUST for everybody.\";s:4:\"edge\";s:304:\"This is a massive update that is intended to maximize compatibility with the latest version of WordPress and other popular plugins. It also includes important security patches, new features, bug fixes, and a whole lot of important changes under the hood. Updating to this version is a MUST for everybody.\";}s:6:\"author\";s:80:\"<a href=\"http://codecanyon.net/user/kreatura\" target=\"_blank\">Kreatura Media</a>\";s:3:\"url\";s:38:\"https://layerslider.kreaturamedia.com/\";s:8:\"external\";b:1;s:9:\"file_name\";s:10:\"plugin.zip\";s:5:\"icons\";a:3:{s:2:\"1x\";s:89:\"https://repository.kreaturamedia.com/v4/updates/1362246/assets/icon-128x128.png?ver=6.9.2\";s:2:\"2x\";s:89:\"https://repository.kreaturamedia.com/v4/updates/1362246/assets/icon-256x256.png?ver=6.9.2\";s:7:\"default\";s:89:\"https://repository.kreaturamedia.com/v4/updates/1362246/assets/icon-256x256.png?ver=6.9.2\";}s:7:\"banners\";a:3:{s:3:\"low\";s:94:\"https://repository.kreaturamedia.com/v4/updates/1362246/assets/thumbnail-772x250.png?ver=6.9.2\";s:4:\"high\";s:95:\"https://repository.kreaturamedia.com/v4/updates/1362246/assets/thumbnail-1544x500.png?ver=6.9.2\";s:7:\"default\";s:95:\"https://repository.kreaturamedia.com/v4/updates/1362246/assets/thumbnail-1544x500.png?ver=6.9.2\";}s:8:\"sections\";a:3:{s:9:\"changelog\";s:343:\"<p style=\"text-align: justify;\">\n	<a href=\"https://layerslider.kreaturamedia.com/release-log/\" target=\"_blank\">Click here to see the release log.</a> Don’t forget, the release log and all product-related news are also integrated right into LayerSlider. Look for the “LayerSlider News” section at the bottom of its main admin screen.\n</p>\";s:12:\"installation\";s:563:\"<p style=\"text-align: justify;\">\n	Updating the plugin won’t touch your sliders or settings. New versions always have backward compatibility. You don’t have to worry about losing your work. Not sure how to update? Check the <a href=\"https://layerslider.kreaturamedia.com/documentation/#updating\" target=\"_blank\">Updating</a> section of our online documentation.\n</p>\n\n<p style=\"text-align: justify;\">\n	If you’re experiencing unwanted changes, it is always a good idea to check your settings since there are probably new options to control those changes.\n</p>\";s:3:\"faq\";s:607:\"<p style=\"text-align: justify;\">\n	Please visit our <a href=\"https://layerslider.kreaturamedia.com/help/\" target=\"_blank\">Help</a> page, where you can find all sorts of useful assets like <a href=\"https://layerslider.kreaturamedia.com/faq/\" target=\"_blank\">FAQs</a>, <a href=\"https://layerslider.kreaturamedia.com/documentation/\" target=\"_blank\">online documentation</a>, <a href=\"https://layerslider.kreaturamedia.com/documentation/#troubleshooting\" target=\"_blank\">troubleshooting</a>, and <a href=\"https://layerslider.kreaturamedia.com/documentation/#support\" target=\"_blank\">support</a> information.\n</p>\";}s:4:\"slug\";s:11:\"LayerSlider\";s:7:\"package\";s:0:\"\";s:13:\"download_link\";s:0:\"\";}s:15:\"_latest_version\";s:6:\"6.11.1\";s:14:\"_not_activated\";b:1;s:7:\"checked\";i:1591081868;}', 'yes'),
